css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.reddit.com") {

body { background:#FFF!important;}
    
.content {
    margin-top:73px !important;
}

#header-bottom-left {
    position:absolute !important;
    background-image:url(data:image/png;base64,) !important;
    width:100%;
    top:0px;
}
    
#header-bottom-right {
    position:absolute !important;
    top:0px !important;
    background-color:transparent !important; 
    height:12px !important;
    color:#FFF !important;
    padding-right:10px !important;
}

#header-bottom-right a {
    color:#F3F3F3 !important;
}

.user {
    color:#CCC !important;
}

.user .userkarma {
    color:#CCC;
}

.link .title {
    margin-bottom: 2px !important;
}
    
#sr-header-area {
    position:absolute !important;
    top:45px;
    width:100%;
    background-color:#92b9ee !important;
}

#sr-header-area a {
    color:#333 !important;
}

.pref-lang {
    font-weight: 100 !important;
}

#sr-header-area .selected a {
    color: #333 !important;
    font-weight:bold !important;
}

.tabmenu li.selected a {
    height:30px !important;
    border-radius:3px 3px 0px 0px;
    border:0px !important;
    color:#333 !important;
    background-color:#92b9ee !important;
}

.tabmenu li a {
    height:30px !important;
    background-color:#22508d !important;
    border-radius:3px 3px 0px 0px;
    border:0px !important;
    color:#CCC !important;
}

#sr-more-link {
    background-image:url(data:image/png;base64,) !important;

    background-color:transparent !important; 
}

.side {
    background-color:#F3F3F3 !important;
    padding:5px !important;
    margin-right:0px !important;
    border-radius:0px 0px 0px 5px;
    border:1px solid #CCC !important;
    border-right:0px !important;
    border-top:0px !important;
    margin-top:63px !important;
}

.sidebox .spacer {
    background-color:transparent !important; 
}

.nub {
    display:none;
}

.keyHighlight {
    outline:1px dashed #22508d !important;
}

.organic-listing {
    border:1px solid #CCC !important;
}

.titlebox form.flairtoggle {
    background-color:transparent !important; 
}

.linkinfo {
    border-radius:0px !important;
    border:1px solid #22508d !important;
}

#searchexpando.infobar {
    border-radius:0px !important;
    background-color:#FFF !important;
    border:1px solid gray !important;
}

.option.active {
    border-radius:0px !important;
}

.morelink {
    background-image:none !important;
    background-color:#F3F3F3 !important;
    border:1px solid #CCC !important;
    font-size:135% !important;
}

a.login-required {
    color:#22508d !important;
}

.footer-parent {
    display:none;
}

/* RES */
#userbarToggle {
    background-color:transparent !important;
    border:none !important;
    margin-top:1px !important;
}

#RESShortcutsEditContainer {
    background-color:transparent !important;
}

#RESShortcutsRight, #RESShortcutsLeft, #RESShortcutsAdd, #RESShortcutsTrash {

    background-image:url(data:image/png;base64,) !important;

    background-color:transparent !important; 

}

.RESShortcutsCurrentSub {
    font-weight:bold !important;
    color:#333 !important;
}

.RESshortcutside {
    border-radius:0px !important;
}

.RESDashboardToggle {
    border-radius:0px !important;
}

}
